class ProjectsApi {
  static getAllProjects() {
    return new Promise((resolve) => {
      setTimeout(() => {
        resolve(Object.assign([], projects));
      }, delay);
    });
  }

  static getProject(key) {
     const project = Object.assign({}, completeProjectDetails[key]);
    return new Promise((resolve) => {
      setTimeout(() => {
        resolve(project);
      }, delay);
    });
  }
}

export default ProjectsApi;
